def alternating_covers(l):
    end0, end1 = [],[list(l)]
    for k in range(len(l)):
        if l[k]==0:
            for x in end1:
                y = x.copy()
                y[k] += 1
                end0.append(y)
        else:
            for x in end0:
                y = x.copy()
                y[k] -= 1
                end1.append(y)
    return [tuple(x) for x in end0]
def a(n):
    N = 2*n+1
    D = {tuple(N*[0]):1}
    for _ in range(N):
        D2 = {}
        for x in D:
            for y in alternating_covers(x):
                if sum(k*(y[k]-x[k]) for k in range(N))==n:
                    if y in D2:
                        D2[y] += D[x]
                    else:
                        D2[y] = D[x]
        D = D2
    return D[tuple(N*[1])]

